export const scrollToView = (link?: string) => {
  const scrollIntoView = document.querySelector(`#${link}`);
  if (scrollIntoView && typeof (link) === "string") {
    gsap.to(window, {
      scrollTo: { y: scrollIntoView, offsetY: 0 },
      duration: 1.5,
      ease: "power1.inOut",
    });
  } else {
    gsap.to(window, {
      scrollTo: { y: 0 },
      duration: 1.5,
      ease: "power1.inOut",
    });
  }
};